import './App.css'; // Add this import at the top of your file
import React from 'react';
import { Route, Routes,Router, Link } from 'react-router-dom';
import Dashboard from './Dashboard';
import BudgetSetter from './BudgetSetter';
import Scheduler from './Scheduler';
import Notifications from './Notifications';

// <BrowserRouter> <BrowserRouter>
function App() {
  return (
    //<h2>hello uhex</h2>
    <Router>
      <div>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/dashboard">Dashboard</Link></li>
          <li><Link to="/budget-setter">Set Budget</Link></li>
          <li><Link to="/scheduler">Scheduler</Link></li>
          <li><Link to="/notifications">Notifications</Link></li>
        </ul>

        <Routes>
          <Route path="/" element={<h1>Welcome to IoT Wall Outlet App</h1>} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/budget-setter" element={<BudgetSetter />} />
          <Route path="/scheduler" element={<Scheduler />} />
          <Route path="/notifications" element={<Notifications />} />
        </Routes>
    </div>
    </Router>
  )
}

export default App;
